In order to use Geo-AID, we have to tell it exactly what we want. We can do this with a script file. Geo-AID uses a special language called GeoScript that lets us give specific instructions. Create the following file with a name of your choice, say figure.geo: let A = Point();
let B = Point();
let C = Point(); AB = AC;
AB = BC; and run it with the following command: geo-aid figure.geo figure.svg After a short wait a new file figure.svg should show up. Open it in any SVG previewer (could even be your browser) and gaze at your first figure in awe: B C A Ok, but what exactly happened here?
